import { useState } from 'react';
import StartPage from './pages/StartPage';
import ChatPage from './pages/ChatPage';



const App = () => {

  const [currentPage, setCurrentPage] = useState<Page>('start');

  return (
    <div style={{ padding: '20px' }}>

      {currentPage === 'start' ? (
        <StartPage />
      ) : (
        <ChatPage />
      )}
    </div>
  );
};

export default App;
